import { useState } from "react";
import Auth from "./Auth";
import Footer from "./Footer";

export default function Landing() {

    const [showStart, setLucky] = useState("ocult")
    

    return (
        <div>
            <div className="landing">
                <div className="left">
                    <div className="tired">
                        Tired of the mess that binance passes off as order
                        history ?
                    </div>
                    <div className="yes-no">
                        <button className="btn-blue-outline">Yes</button>
                        <button className="btn-blue-outline">No</button>
                    </div>
                    <div className={showStart}>
                        <div className="lucky ">
                            Well if that is the case, this is your lucky day! In
                            this website you have the superpower to{" "}
                            <text>convert</text> the boring and troubeling{" "}
                            <text>excel</text> sheet in{" "}
                            <text>statistics for humans</text>.
                        </div>
                        <div className="getstarted ">
                            <button className="btn-blue">Get started!</button>
                        </div>
                    </div>    
                </div>
                <div className="right"></div>
            </div>
           <Footer/>
        </div>
    );
}
